import React from "react";
import {
  Balance,
  IncomeExpense,
  NewTransactionForm,
  TransactionList,
} from "../../components";

const Homes = () => {
  return (
    <div className="home">
      <div className="container">
        <Balance />
        <IncomeExpense />
        <TransactionList />
        <NewTransactionForm />
      </div>
    </div>
  );
};

export default Home;
